import { queryAllByAltText } from "@testing-library/dom";
import axios from "axios";
import React from "react";
import Image from "./Image";
import { useEffect, useState } from "react";

export default function TableRow({  render, row, tableData, tableDisplay, key, onClickPic }) {
const [renderTable, setRenderTable] = useState([])
useEffect(()=>{
  setRenderTable(tableData.map((el) => (
    <tr onClick={(e) => onClickPic(el.speciesCode)} className={el.comName}>
      <td colSpan="1">{el.comName}</td>
      <td colSpan="1">{el.sciName}</td>
      <td>{el.locName}</td>
      <td>{el.obsDt}</td>
    </tr>
  )))
}, tableData)



  return (
    <div>
      <thead className="thead">
        <tr className="row-head">
          <th colSpan="1" scope="col">
            Common Name
          </th>
          <th colSpan="1" scope="col" data-label="Scientific Name">
            Scientific Name
          </th>
          <th colSpan="1">Location</th>
          <th colSpan="1">Date</th>
        </tr>
      </thead>
      <tbody>{renderTable}</tbody>
    </div>
  );
}
